import {
    Form,
    FormGroup,
    Input,
    Label,
    Button,
    Container,
    Row,
    Col,
  } from "reactstrap";
  import { useState, useEffect } from "react";
  import { useDispatch, useSelector } from "react-redux";
  import { BrowserRouter as Router, useNavigate } from "react-router-dom";
  import { updateUserProfile } from "../Features/UserSlice";
  import { useForm } from "react-hook-form";
  import { yupResolver } from "@hookform/resolvers/yup";
  import { userValidationsSchema } from "../Validation/UserValidation";
  import Location from "./Location";
  import profile from "../Images/profile.png";
  import loc from "../Images/loc.png";
const Profile = () => {
   const {  fristname, lastname, isLoading, isError } = useSelector((state) => state.users);
 
    const email = useSelector((state) => state.users.user.email);
    const user = useSelector((state) => state.users.user);
    const [name, setUserNamef] = useState(user.name);
    const [pwd, setPwd] = useState(user.password);
    const [profilePic, setProfilePic] = useState(user.profilePic);
 
    const navigate = useNavigate();
    const dispatch = useDispatch();
 
 
    const {
      register,
      handleSubmit, // Submit the form when this is called
      formState: { errors },
    } = useForm({
      resolver: yupResolver(userValidationsSchema),
    });
  const handleUpdate = (event) => {
      event.preventDefault();
 
     
      const userData = {
        email: user.email,
        name: name,
        password: pwd,
      };
      console.log(userData);
     
      dispatch(updateUserProfile(userData));
      alert("Profile Updated.");
      // Navigate back to the profile page after the update is completed
      navigate("/login");
    };
   
    const handleFileChange = (event) => {
      // Use e.target.files[0] to get the file itself
      const uploadFile = event.target.files[0];
      if (!uploadFile) alert("No file uploaded");
      else setProfilePic(event.target.files[0]);
    };
 
    useEffect(() => {
      if (!user.email) {
        navigate("/login");
      }
    }, [user.email, navigate]);
 
  /*useEffect(() => {
    // ðŸ§  Get user info from localStorage or dummy data
    const storedUser = JSON.parse(localStorage.getItem("userProfile")) || {
      name: "Guest User",
      email: "guest@example.com",
      location: "Unknown",
    };
    setUser(storedUser);
  }, []);
 
  const handleUpdateProfile = () => {
    navigate("/update-profile");
  };*/
 
  return (
   <Container fluid>
       
        <Row>
          <Col md={7} className="userdisplay">
            <img src={profile} alt="user" className="profileImage" />
           
            {/* <User /> */}
         
          <Col md={4}>
            <Form onSubmit={handleUpdate}>
              Upload Photo
              <br />
              <input type="file" name="profilePic" onChange={handleFileChange} />
              <FormGroup>
                <Label for="name">full Name</Label>
                <Input
                  id="name"
                  name="name"
                  placeholder="name..."
                  type="text"
                  value={name}
                  {...register("name", {
                    onChange: (e) => {
                      setUserNamef(e.target.value);
                    },
                  })}
                />
              </FormGroup>
              <FormGroup>
                <Label for="password">Password</Label>
                <Input
                  id="password"
                  name="password"
                  placeholder="Password..."
                  type="password"
                  value={pwd}
                  {...register("password", {
                    onChange: (e) => {
                      setPwd(e.target.value);
                    },
                  })}
                />
              </FormGroup>
           
              <FormGroup>
                <Button color="primary" className="button" type="submit">
                  Update Profile
                </Button>
              </FormGroup>
            </Form>
          </Col>
         </Col>
 
          <Col md={4} className="locationDisplay">
            <img src={loc} alt="location" className="profileImage" />
            <h1>YOUR LOCATION</h1>
            <Location />
          </Col>
        </Row>
      </Container>
  );
};
 
export default Profile;
